import React from 'react'
import ReactDOM from 'react-dom'
import App from './App'

// This file is where we initialize the Mock Service Worker
if (process.env.NODE_ENV === 'development') {
  const {worker} = require('./mocks/browser')

  // This is the updated, more stable way to start the worker
  worker.start({
    onUnhandledRequest: 'bypass',
  })
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root'),
)
